import React from 'react';

import './Panel.scss';

import Button from '../Button/Button';
import TasksList from '../TasksList/TasksList';

const Panel = () => {
    return (
        <div className="panel">
            <Button buttonText="+ Add Task" />
            <TasksList />
        </div>
    );
}

export default Panel;
